import React from 'react'
import Slider from 'react-slick'

const GalleryServicePageCard = () => {

    // for slider
    const settings = {
        // dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1
    };

    return (
        <div className="simple-sliders">
            <div className="slider-heading">
                <h2>Recommended Services</h2>
            </div>
            <div className='service_block'>
                <Slider {...settings}>
                    <GalleryServicePageCard />
                </Slider>

            </div>
        </div>
    )
}

export default GalleryServicePageCard
